import React from 'react';

function CatalogCategory(){
	return(
		<div className="catalog-category">
            <div className="catalog-category-item active">Русская баня</div>
            <div className="catalog-category-item">Финская сауна</div>
            <div className="catalog-category-item">Турецкий хаммам</div>
            <div className="catalog-category-item">Японская офуро</div>
            <div className="catalog-category-more">Ещё</div>
        </div>
	);
}

export default CatalogCategory;
